sap.ui.define(['sap/ui/webc/common/thirdparty/base/renderer/LitRenderer'], function (litRender) { 'use strict';

	const block0 = (context, tags, suffix) => litRender.html`<div class="ui5-checkbox-root ${litRender.classMap(context.classes.main)}" role="checkbox" aria-checked="${litRender.ifDefined(context.ariaChecked)}" aria-readonly="${litRender.ifDefined(context.ariaReadonly)}" aria-disabled="${litRender.ifDefined(context.ariaDisabled)}" aria-labelledby="${litRender.ifDefined(context.ariaLabelledBy)}" aria-describedby="${litRender.ifDefined(context.ariaDescribedBy)}" tabindex="${litRender.ifDefined(context.tabIndex)}" @keydown="${context._onkeydown}" @keyup="${context._onkeyup}" @click="${context._onclick}" dir="${litRender.ifDefined(context.effectiveDir)}"><div id="${litRender.ifDefined(context._id)}-CbBg" class="ui5-checkbox-inner">${ context.isCompletelyChecked ? block1(context, tags, suffix) : undefined }<input id="${litRender.ifDefined(context._id)}-CB" type='checkbox' ?checked="${context.checked}" ?readonly="${context.readonly}" ?disabled="${context.disabled}" tabindex="-1" aria-hidden="true" data-sap-no-tab-ref /></div>${ context.text ? block2(context, tags, suffix) : undefined }${ context.hasValueState ? block3(context) : undefined }<slot name="formSupport"></slot></div>`;
	const block1 = (context, tags, suffix) => litRender.html`<${litRender.scopeTag("ui5-icon", tags, suffix)} aria-hidden="true" name="accept" class="ui5-checkbox-icon"></${litRender.scopeTag("ui5-icon", tags, suffix)}>`;
	const block2 = (context, tags, suffix) => litRender.html`<${litRender.scopeTag("ui5-label", tags, suffix)} id="${litRender.ifDefined(context._id)}-label" class="ui5-checkbox-label" wrapping-type="${litRender.ifDefined(context.wrappingType)}">${litRender.ifDefined(context.text)}</${litRender.scopeTag("ui5-label", tags, suffix)}>`;
	const block3 = (context, tags, suffix) => litRender.html`<span id="${litRender.ifDefined(context._id)}-descr" class="ui5-hidden-text">${litRender.ifDefined(context.valueStateText)}</span>`;

	return block0;

});
